ges between two cylinders, one at each end of the engine. This allowed the crankshaft to be better balanced, resulting in a smoother, faster-responding engine which ran with less vibration. This made the 4-cylinder triple-expansion engine popular with large passenger liners (such as the Olympic class), but this was ultimately replaced by the virtually vibration-free turbine engine.[citation needed]\nIn what century was the Yarrow-Schlick-Tweedy balancing system used?','data.extraction','Results: [19th]','The Yarrow-Schlick-Tweedy balancing system was used in the late 19th century.',5,NULL,'https://rajpurkar.github.io/SQuAD-explorer','high','2023-06-04 23:43:32','gpt-3.5-turbo'),('chatcmpl-7NoRRpL07sWY4tkeujjVmmfHBEPA6','Data extraction: Sky (United Kingdom)','Consider the following paragraph about \"Sky (United Kingdom)\":\nWhile BSkyB had been excluded from being a part of the ONdigital consortium, thereby making them a competitor by default, BSkyB was able to join ITV Digital\'s free-to-air replacement, Freeview, in which it holds an equal stake with the BBC, ITV, Channel 4 and National Grid Wireless. Prior to October 2005, three BSkyB channels were available on this platform: Sky News, Sky Three, and Sky Sports News. Initially BSkyB provided Sky Travel to the service. However, this was replaced by Sky Three on 31 October 2005, which was itself later re-branded as \'Pick TV\' in 2011.\nWho did BSkyB team up with because it was not part of the consortium?','data.extraction','Results: [ITV Digital, Freeview]','BSkyB joined ITV Digital\'s replacement Freeview, in which it holds an equal stake with the BBC, ITV, Channel 4, and National Grid Wireless.',5,NULL,'https://rajpurkar.github.io/SQuAD-explorer','high','2023-06-04 23:16:40','gpt-3.5-turbo'),('chatcmpl-7NoRw6bJ0mRCymvyuNzeT6XFkm7ce','Data extraction: Sky (United Kingdom)','Consider the following paragraph about \"Sky (United Kingdom)\":\nWhile BSkyB had been excluded from being a part of the ONdigital consortium